	module.exports = {"data":{"markdownRemark":{"html":"<p>Phương thức <code class=\"language-text\">**slice**</code> (copy cho em một miếng) có thể sử dụng trên 2 kiểu <code class=\"language-text\">String</code> và <code class=\"language-text\">Array</code>\t</p>\n<p>Cách sử dụng cơ bản thì ta có thể truyền vào index bắt đầu, và index kết thúc (<em>kết quả tả về không bao gồm index kết thúc</em>)</p>\n<p><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--OINYunXY--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-0.jpg\"></p>\n<p>Index kết thúc cũng có thể <em>bỏ qua</em>, lúc này nó sẽ hiểu là lấy hết luôn các phần tử còn lại.</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--z2KQG8vX--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/xxjavascript-array-slice-method-foxbits-fact-2.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--z2KQG8vX--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/xxjavascript-array-slice-method-foxbits-fact-2.jpg\" alt=\"Javascript Array Slice Method: The default end parameter is length of the array\"></a></p>\n<p>Và nếu mà chúng ta truyền giá trị index kết thúc nó lớn hơn chiều dài của mảng, thì nó cũng không lỗi, mà trả về toàn bộ như không truyền vào</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--eWuiw3eO--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-3_0.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--eWuiw3eO--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-3_0.jpg\" alt=\"Javascript Array Slice Method: When the end value is higher than actual length of array.\"></a></p>\n<p>Còn vui vui, bạn không truyền vào index bắt đầu luôn, thì nó cũng không lỗi nốt, mà sẽ sao y toàn bộ các phần tử vào mảng mới</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--0VNTZhPe--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-4_0.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--0VNTZhPe--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-4_0.jpg\" alt=\" Edit media Image  When both parameters are missing, it creates copy of the original array\"></a></p>\n<p>Với index bắt đầu nhận vào là <code class=\"language-text\">undefined</code> nó sẽ hiểu là <code class=\"language-text\">0</code> (em cũng lại javascript)</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--ZziXO8ik--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-5.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--ZziXO8ik--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-5.jpg\" alt=\"Javascript Array Slice Method: If first parameter is undefined, then the result contains elements from the starting point of the array.\"></a></p>\n<p>Index bắt đầu lớn hơn độ dài của array? Nó sẽ cho ta kết qua là một mảng rỗng</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--WQBi7Kp_--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-6_0.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--WQBi7Kp_--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-6_0.jpg\" alt=\"Javascript Array Slice Method: When begin is greater than or equal to length of array.\"></a></p>\n<blockquote>\n<p>Chưa đủ thú vị? Vậy truyền vào số âm thì sao?</p>\n</blockquote>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--Z0m01uqP--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-negative-index.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--Z0m01uqP--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-negative-index.jpg\" alt=\"Negative Indexing of array elements in Javascript\"></a></p>\n<p>Lúc này nó sẽ được tính theo cơ chế <em>index ngược</em>, các giá trị <em>âm</em> sẽ được tính theo index: thằng cuối cùng là -1, áp cuối là -2, và cứ tiếp tục đi ngược lên.</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--9QHx20P0--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-8.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--9QHx20P0--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-8.jpg\" alt=\"Slice method with negative index works fine\"></a></p>\n<p>Chúng ta có thể dùng nó để lấy các phần tử từ phải qua trái (2 phần tử cuối, 3 phần tử cuối, ví dụ vậy)</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--VkOdOPne--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-9.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--VkOdOPne--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/array-slice-example-fruits-for-fact-9.jpg\" alt=\"Using Slice with negative index to fetch last 4 elements of an array\"></a></p>\n<p>Đối với String thì cũng cách dùng cũng tương tự như Array (mai quá!)</p>\n<p><a href=\"https://res.cloudinary.com/practicaldev/image/fetch/s--sfq02PID--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/string-slice.jpg\"><img src=\"https://res.cloudinary.com/practicaldev/image/fetch/s--sfq02PID--/c_limit%2Cf_auto%2Cfl_progressive%2Cq_auto%2Cw_880/https://foxbits.dev/sites/default/files/inline-images/string-slice.jpg\" alt=\"Javascript String Slice Method\"></a></p>\n<p>Mình nghĩ <code class=\"language-text\">slice</code> cũng là một trong những phương thức chúng rất hay sử dụng, như trong reducer của redux, dùng nó để sao y một state nào đó. Nên việc nắm vững, thực hành với nó nhiều là điều rất chi cần thiết.</p>\n<p><a href=\"https://dev.to/sandeshgit/understanding-the-slice-method-in-javascript-the-basics-negative-indexing-and-the-concept-of-shallow-copy-3m3i\">https://dev.to/sandeshgit/understanding-the-slice-method-in-javascript-the-basics-negative-indexing-and-the-concept-of-shallow-copy-3m3i</a></p>","timeToRead":3,"excerpt":"Phương thức   (copy cho em một miếng) có thể sử dụng trên 2 kiểu   và  \t Cách sử dụng cơ bản thì ta có thể truyền vào index bắt đầu, và…","frontmatter":{"title":"Tìm hiểu phương thức slice của mảng trong javascript","cover":"https://res.cloudinary.com/practicaldev/image/fetch/s--hrMTCnVB--/c_imagga_scale,f_auto,fl_progressive,h_420,q_auto,w_1000/https://dev-to-uploads.s3.amazonaws.com/i/2u8lvreli9tyeef7tn1e.png","date":"2020-08-14","category":null,"tags":["javascript"],"desc":"Bài viết phù họp cho các bạn mới biết javascript, không phù hợp cho bạn nào đã quá rành"},"fields":{"slug":"/2020-08-14-tim-hieu-phuong-thuc-slice-trọng-javascript"}}},"pathContext":{"slug":"/2020-08-14-tim-hieu-phuong-thuc-slice-trọng-javascript","prev":false,"next":{"frontmatter":{"title":"Thêm kiểm tra type trong Javascript với VS Code","desc":"Bạn thấy rằng JavaScript đã đủ xài trong dự án, bạn không ưa thằng TypeScript và bạn đang sử dụng VS Code. Bài viết này là dành cho bạn rồi.","type":"post","category":null,"tags":["javascript","thu-thuat"],"date":"2020-08-06","cover":""},"fields":{"slug":"/2020-08-06-them-type-check-cho-javascript-voi-vscode"}}}}

